INSERT INTO `example` VALUES ('B4227BACE853444FA42603B9F4AFAD71', null, 'SUCCESS', '{\n  \"requestId\": \"25420\",\n  \"code\": \"200\",\n  \"httpCode\": \"200\",\n  \"message\": \"ok\",\n  \"result\": [\n    {\n      \"visible\": false,\n      \"create_name\": \"王彩娟\",\n      \"scene_id\": \"8a2a746856a0fb1d0156bb2317562a9f\",\n      \"frequency\": \"2/周\",\n      \"type\": true,\n      \"book_type\": \"191bb9fb41a341df861d0d52f6035517\",\n      \"id\": \"8a2a746856ea6fb101574591926714fa\",\n      \"area\": null,\n      \"resource_origin_id\": \"8a2a746856da5b0e0156df45949a0b2c\",\n      \"create_date\": 1474340950000,\n      \"hour_count\": 26,\n      \"course_time\": \"\",\n      \"name\": \"六年级数学（上）同步课程\",\n      \"scene_user\": null,\n      \"isdel\": false,\n      \"status\": null,\n      \"id_number\": \"\",\n      \"extend1\": null,\n      \"extend3\": null,\n      \"extend2\": null,\n      \"subject_code\": \"2\",\n      \"section\": null,\n      \"difficult_star\": 2,\n      \"suggest_period\": null,\n      \"duration\": \"30\",\n      \"rt_category_code\": \"is_003\",\n      \"grade_code\": \"16\",\n      \"suggest_price\": \"1300\",\n      \"update_name\": null,\n      \"update_date\": 1483953753000,\n      \"goal_score\": 90,\n      \"teaching_goal\": \"<p>1、理解分数乘、除法的意义，掌握分数乘、除法的计算方法，比较熟练地</p><p>计算简单的分数乘、除法，会进行简单的分数四则混合运算。</p><p>2、理解倒数的意义，掌握求倒数的方法。</p><p>3、理解比的意义和性质，会求比值和化简比，会解决有关比的简单实际问</p><p>题。</p><p>4、掌握圆的特征，会用圆规画圆；探索并掌握圆的周长和面积公式，能够</p><p>正确计算圆的周长和面积。</p><p>5、知道圆是轴对称图形，进一步认识轴对称图形；能运用平移、轴对称和</p><p>旋转设计简单的图案。</p><p>6、理解百分数的意义，比较熟练地进行有关百分数的计算，能够解决有关</p><p>百分数的简单实际问题。</p><p>7、认识扇形统计图，能根据需要选择合适的统计图表示数据。</p><p>8、经历从实际生活中发现问题、提出问题、解决问题的过程，体会数学在</p><p>日常生活中的作用，初步形成综合运用数学知识解决问题的能力。</p><p>9、体会解决问题策略的多样性及运用假设的数学思想方法解决问题的有</p><p>效性，感受数学的魅力。形成发现生活中的数学的意识，初步形成观察、分析及推理的能力。</p><p>10、体会学习数学的乐趣，提高学习数学的兴趣，建立学好数学的信心。</p><p>11、养成认真作业、书写整洁的良好习惯。</p><p><br/></p>\",\n      \"categories_code\": \"007\"\n    },\n    {\n      \"visible\": false,\n      \"create_name\": \"王彩娟\"