圆规画圆；探索并掌握圆的周长和面积公式，能够</p><p>正确计算圆的周长和面积。</p><p>5、知道圆是轴对称图形，进一步认识轴对称图形；能运用平移、轴对称和</p><p>旋转设计简单的图案。</p><p>6、理解百分数的意义，比较熟练地进行有关百分数的计算，能够解决有关</p><p>百分数的简单实际问题。</p><p>7、认识扇形统计图，能根据需要选择合适的统计图表示数据。</p><p>8、经历从实际生活中发现问题、提出问题、解决问题的过程，体会数学在</p><p>日常生活中的作用，初步形成综合运用数学知识解决问题的能力。</p><p>9、体会解决问题策略的多样性及运用假设的数学思想方法解决问题的有</p><p>效性，感受数学的魅力。形成发现生活中的数学的意识，初步形成观察、分析及推理的能力。</p><p>10、体会学习数学的乐趣，提高学习数学的兴趣，建立学好数学的信心。</p><p>11、养成认真作业、书写整洁的良好习惯。</p>\",\n      \"categories_code\": \"009\"\n    }\n  ]\n}', null, null);
